import React from "react";



function Characters(props){
    return(
        <div className="characters-container">
            {props.Characters}
            <div className="img-containers"><img src="./character1.png" alt="character 1"></img></div>
            <div className="img-containers"><img src="./character2.png" alt="character 2"></img></div>
            <div className="img-containers"><img src="./character3.png" alt="character 3"></img></div>
        </div>
    )
}

export default Characters;
